import React, { useState } from 'react';
import Sidebar from '../components/Sidebar';
import CssBaseline from '@mui/material/CssBaseline';
import Container from '@mui/material/Container';
import OptionTab from '../components/OptionTab';

const Undefined = () => {
  const [droppedTab, setDroppedTab] = useState(false);

  const handleTabDragStart = () => {
    // Handle the start of the tab drag
  };

  const handleTabDragEnd = () => {
    // Handle the end of the tab drag
    setDroppedTab(true);
  };

  return (
    <div style={{ display: 'flex', marginTop:"200px" }}>
      <CssBaseline />
      <Sidebar />
      <Container
        onDragOver={(e) => e.preventDefault()} // Prevent default behavior to allow drop
        onDrop={() => setDroppedTab(true)} // Handle the drop action
        style={{ minHeight: '100vh' }}
      >
        {/* Your main content goes here */}
        <h1>Main Content</h1>
        <OptionTab/>
        {droppedTab == false ? (
          <OptionTab onDragStart={handleTabDragStart} onDragEnd={handleTabDragEnd} />
        ) : null}
      </Container>
    </div>
  );
};

export default Undefined;
